import React from "react";
import HomePage from "../src/pages/homepage/homepage.component";
import { Route } from "react-router-dom";
import "./App.css";

const Testpage = () => (
  <div>
    <h1>test page</h1>
  </div>
)


function App() {
  return (
    <React.Fragment>
    <Route exact={true} path="/" component={HomePage}/>
      <HomePage />
    </React.Fragment>
  );
}

export default App;
